using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using TestingFramework.Core.Base;
using TestingFramework.Core.Models;
using TelerikSystem.Core.Pages.LoginPage;
using TelerikSystem.Core.User.SoftwareAcademy.Pages.ApplySofAcademyPage;
using TelerikSystem.Core.Pages.MainPage;

namespace TelerikSystem.Tests.User.SoftwareAcademy
{
    [TestClass]
    public class ApplySofAcademyAddQuest09 :BaseTest
    {
        private TestingFramework.Core.Models.User currentUser;
        private readonly string[] invalidData = { "", "    " };
        private readonly string[] validData = { @"\ / : * ? "" < > | ", "<script>", "</script>", "<script>hI</script>", "some text", "някакъв текст", "いくつかのテキスト", "بعض النص",
                                                  "some < text","some > text","some | text" ,"some ' text" , "123456",""};

        public override void TestInit()
        {
            this.currentUser = GetUser.NotFillApplicationForm();
            this.currentUser.Username = "ccccc";
            this.currentUser.Password = "123456";
        }


        [TestMethod]
        public void ApplySofAcademy_AssertMainErrorMessageQ9_InvalidCarierCenter_InvalidInputData()
        {
            for (int i = 0; i < invalidData.Length; i++)
            {
                Pages<LoginPage>.Instance.LoginUser(currentUser);
                Pages<ApplySofAcademyPage>.Instance.Navigate();
                Pages<ApplySofAcademyPage>.Instance.Validator.AssertCantApplyAsQ09_InvalidCarierCenter_InvalidInputData(invalidData[i]);
                Pages<MainPage>.Instance.LogOut();
            }
        }

        [TestMethod]
        public void ApplySofAcademy_AssertMainErrorMessageQ9_InvalidCarierCenter_ValidInputData()
        {
            for (int i = 0; i < validData.Length; i++)
            {
                Pages<LoginPage>.Instance.LoginUser(currentUser);
                Pages<ApplySofAcademyPage>.Instance.Navigate();
                Pages<ApplySofAcademyPage>.Instance.Validator.AssertCantApplyAsQ09_InvalidCarierCenter_ValidInputData(validData[i]);
                Pages<MainPage>.Instance.LogOut();
            }
        }
    }
}
